import * as React from "react";
import { useState, useEffect } from "react";
import styled from "styled-components";
import axios from "axios";
import CategorieTab from "../components/CategoryTab";

interface CategorieDB {
  item: Categories;
}
interface Categories {
  categoryPk: number;
  categoryName: string;
  categoryCode: string;
}

export default function Home({ item: i }: CategorieDB) {
  const [categorieDB, setCategorieDB] = useState(i);

  const axios_GetCategorie = () => {
    axios
      .get("./data/Categories.json")
      .then((res) => setCategorieDB(res.data.CATEGORIES));
  };
  useEffect(() => {
    axios_GetCategorie();
  }, []);
  console.log(categorieDB);
  return (
    <Container>
      <Header>커뮤니티</Header>

      {/* {categorieDB.map((el) => {
        <CategorieTab />;
      })} */}
    </Container>
  );
}

const Container = styled.div`
  display: flex;
  position: relative;
  align-items: center;
  justify-content: center;
  flex-direction: column;
`;
const Header = styled.header`
  position: absolute;
  top: 34px;
  left: 30px;
  width: 81px;
  line-height: 32px;
  height: 32px;
  font-weight: 700;
  font-size: 22px;
`;
